import React from 'react';
import CapabilityCard from './CapabilityCard';
import './Capability.css';

function Capability() {
	return (
		<div className="capability_cards">
			<h1>Our Capability</h1>
			<div className="cards__container">
				<div className="cards__wrapper">
					<div style={{ display: 'flex', justifyContent: 'space-around' }}>
						<CapabilityCard text="IN HOUSE STUDIO SET UP" src="/image/in_house.jpg" />
						<CapabilityCard text="HIGH TECHNOLOGY EQUIPMENTS" src="/image/hitech.jpg" />
						<CapabilityCard text="TOP-CLASS VIDEOGRAPHY" />
					</div>
				</div>
			</div>
		</div>
	);
}

export default Capability;
